handleClick(event){
firebase.auth().signOut().then(() => {

   console.log(" Sign-out successful.")
}).catch(function(error) {

  console.log(error);
});
return

}
render(){
    return(
        <div>
           <Button bsStyle="primary" onClick={(event) => this.handleClick(event)}>Log Out </Button>
        </div>
    );
 }
}
